import { SellerLoginComponent } from './seller/seller-login/seller-login.component';
import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { RouterModule } from '@angular/router';
import { ReactiveFormsModule } from '@angular/forms';
import { BuyerModule } from './buyer/buyer.module';
import { SellerModule } from './seller/seller.module';
import { HttpClientModule } from "@angular/common/http";


import { AppComponent } from './app.component';
import { TopBarComponent } from './top-bar/top-bar.component';
import { FooterComponent } from './footer/footer.component'
import { RegistrationComponent } from './registration/registration.component';
import { BuyerDashboardComponent } from './buyer/buyer-dashboard/buyer-dashboard.component';
import { SearchBarComponent } from './buyer/search-bar/search-bar.component';
import { ProductListComponent } from './buyer/product-list/product-list.component';
import { ProductDetailsComponent } from './buyer/product-details/product-details.component'
import { CartComponent } from './buyer/cart/cart.component';
import { PreviousOrderComponent } from './buyer/previous-order/previous-order.component';
import { SellerDashboardComponent } from './seller/seller-dashboard/seller-dashboard.component';
import { AddProductsComponent } from './seller/add-products/add-products.component';
import { Ng2SearchPipeModule } from 'ng2-search-filter';
import { LoginComponent } from './login/login.component';

@NgModule({
  imports: [
    BrowserModule,
    ReactiveFormsModule,
    HttpClientModule,
    Ng2SearchPipeModule,
    RouterModule.forRoot([
      { path: '', component: LoginComponent },
      { path: 'buyer',component: BuyerDashboardComponent},
      { path: 'products/:productId', component: ProductDetailsComponent },
      { path: 'cart', component: CartComponent },
      { path: 'previous_order', component: PreviousOrderComponent},
      { path: 'seller', component: SellerDashboardComponent },
      { path: 'sellers/:sellername/addProducts', component: AddProductsComponent },
      { path: 'sellers/:sellername', component: SellerDashboardComponent },
      { path: 'seller/login', component: SellerLoginComponent}
    ])
  ],
  declarations: [
    AppComponent,
    TopBarComponent,
    RegistrationComponent,
    FooterComponent,
    LoginComponent,    
  ],

  bootstrap: [
    AppComponent
  ]
})
export class AppModule { }
